INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`, `encrypted_data_key`) VALUES (1, 'application-dev.yml', 'DEFAULT_GROUP', 'spring:\n  autoconfigure:\n    exclude: com.alibaba.druid.spring.boot.autoconfigure.DruidDataSourceAutoConfigure\n  mvc:\n    pathmatch:\n      matching-strategy: ant_path_matcher\n\n# feign 配置\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: true\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        connectTimeout: 10000\n        readTimeout: 10000\n  compression:\n    request:\n      enabled: true\n    response:\n      enabled: true\n\n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n\n\n# tencent:\n#   SecretId: xxxxx\n#   SecretKey: xxxxx\n#   sms:\n#       AppKey: xxxxx\n#       SignName: xxxxx\n#       SdkAppId: xxxx\n#       TemplateID: xxxx\n\n\n\n# 本地文件上传    \nfile:\n    domain: http://127.0.0.1:9300\n    path: /Users/yyyz/Desktop/开源项目/YyyProject/uploadPath\n    prefix: /statics\n\n\n\n# 阿里云配置\naliyun:\n  endpoint: oss-cn-hangzhou.aliyuncs.com\n  accessKeyId: LTAI5tN7V1nzWEezuLZ17dBC\n  accessKeySecret: jpTKv2wOZ9AMWh1aCbPI2UD9PZ1EQu\n  bucketName: aicloud888\n  # urlPrefix:\n', '319efdc4448570f109524ca53b02f39d', '2020-05-20 12:00:00', '2023-06-10 05:46:59', 'nacos', '0:0:0:0:0:0:0:1', '', '', '通用配置', 'null', 'null', 'yaml', '', '');
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`, `encrypted_data_key`) VALUES (2, 'yyy-gateway-dev.yml', 'DEFAULT_GROUP', 'spring:\n  redis:\n    host: localhost\n    port: 6379\n    database: 0\n    timeout: 10000\n    #自定义属性\n    expire: 60000\n  cache:\n    type: redis\n    #设置缓存过期时间  防止缓存雪崩：大量key同时过期\n    redis:\n      time-to-live: 3600000\n      #指定默认前缀，如果此处我们指定了前缀则使用我们指定的前缀，推荐此处不指定前缀\n      #spring.cache.redis.key-prefix=CACHE_\n      #是否开始前缀，建议开启\n      use-key-prefix: true\n      #是否缓存空值，防止缓存穿透\n      cache-null-values: true\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          lowerCaseServiceId: true\n          enabled: true\n      routes:\n        # 认证中心\n        - id: yyy-auth\n          uri: lb://yyy-auth\n          predicates:\n            - Path=/auth/**  #当请求路径与 /auth/** 匹配时，该请求才能被转发到 http://localhost:9200 上(对应yyy-auth服务的端口9200)。\n          filters:\n            # 验证码处理\n            - CacheRequestFilter\n            - ValidateCodeFilter\n            - StripPrefix=1     #StripPrefix=1配置，表示网关转发到业务模块时候会自动截取前缀。\n        # 代码生成\n        - id: yyy-gen\n          uri: lb://yyy-gen\n          predicates:\n            - Path=/code/**\n          filters:\n            - StripPrefix=1\n        # 定时任务\n        - id: yyy-job\n          uri: lb://yyy-job\n          predicates:\n            - Path=/schedule/**\n          filters:\n            - StripPrefix=1\n        # 系统模块\n        - id: yyy-system\n          uri: lb://yyy-system\n          predicates:\n            - Path=/system/**\n          filters:\n            - StripPrefix=1\n            #黑名单配置\n            # - name: BlackListUrlFilter\n            #   args:\n            #     blacklistUrl:\n            #     - /user/list\n        # mq模块\n        - id: yyy-rabbit\n          uri: lb://yyy-rabbit\n          predicates:\n            - Path=/rabbit/**\n          filters:\n            - StripPrefix=1\n        # 测试模块\n        - id: yyy-test\n          uri: lb://yyy-test\n          predicates:\n            - Path=/test/**\n          filters:\n            - StripPrefix=1\n\n# 安全配置\nsecurity:\n  # 验证码\n  captcha:\n    enabled: false\n    type: math\n  # 防止XSS攻击\n  xss:\n    enabled: true\n    excludeUrls:\n      - /system/notice\n  # 不校验白名单\n  ignore:\n    whites:\n      - /auth/logout\n      - /auth/login\n      - /auth/register\n      - /*/v2/api-docs\n      - /csrf\n', '9d5299c4cb1d9d4f51c07cef1aaaccd4', '2020-05-14 14:17:55', '2023-06-09 10:17:55', 'nacos', '0:0:0:0:0:0:0:1', '', '', '网关模块', 'null', 'null', 'yaml', '', '');
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`, `encrypted_data_key`) VALUES (3, 'yyy-auth-dev.yml', 'DEFAULT_GROUP', 'spring:\n  redis:\n    host: localhost\n    port: 6379\n    database: 0\n    timeout: 10000\n    #自定义属性\n    expire: 60000\n  cache:\n    type: redis\n    #设置缓存过期时间  防止缓存雪崩：大量key同时过期\n    redis:\n      time-to-live: 3600000\n      #指定默认前缀，如果此处我们指定了前缀则使用我们指定的前缀，推荐此处不指定前缀\n      #spring.cache.redis.key-prefix=CACHE_\n      #是否开始前缀，建议开启\n      use-key-prefix: true\n      #是否缓存空值，防止缓存穿透\n      cache-null-values: true\n# swagger配置\nswagger:\n  title: 权限模块接口文档\n  license: Powered By yyy\n  licenseUrl: https://yyy.vip', 'a1fd6bdf3bf3909e6b25ec2f9a2285c8', '2020-11-20 00:00:00', '2023-06-04 07:26:24', 'nacos', '0:0:0:0:0:0:0:1', '', '', '认证中心', 'null', 'null', 'yaml', '', '');
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`, `encrypted_data_key`) VALUES (4, 'yyy-monitor-dev.yml', 'DEFAULT_GROUP', '# spring\nspring:\n  security:\n    user:\n      name: yyy\n      password: 123456\n  boot:\n    admin:\n      ui:\n        title: 服务状态监控\n', '871b68bf175d5e9da240f26c4ea41497', '2020-11-20 00:00:00', '2023-06-01 22:47:43', 'nacos', '0:0:0:0:0:0:0:1', '', '', '监控中心', 'null', 'null', 'yaml', '', '');
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`, `encrypted_data_key`) VALUES (5, 'yyy-system-dev.yml', 'DEFAULT_GROUP', '# spring配置\nspring:\n  redis:\n    host: localhost\n    port: 6379\n    database: 0\n    timeout: 10000\n    #自定义属性\n    expire: 60000\n  cache:\n    type: redis\n    #设置缓存过期时间  防止缓存雪崩：大量key同时过期\n    redis:\n      time-to-live: 3600000\n      #指定默认前缀，如果此处我们指定了前缀则使用我们指定的前缀，推荐此处不指定前缀\n      #spring.cache.redis.key-prefix=CACHE_\n      #是否开始前缀，建议开启\n      use-key-prefix: true\n      #是否缓存空值，防止缓存穿透\n      cache-null-values: true\n  datasource:\n    druid:\n      stat-view-servlet:\n        enabled: true\n        loginUsername: admin\n        loginPassword: 123456\n    dynamic:\n      druid:\n        initial-size: 5\n        min-idle: 5\n        maxActive: 20\n        maxWait: 60000\n        timeBetweenEvictionRunsMillis: 60000\n        minEvictableIdleTimeMillis: 300000\n        validationQuery: SELECT 1 FROM DUAL\n        testWhileIdle: true\n        testOnBorrow: false\n        testOnReturn: false\n        poolPreparedStatements: true\n        maxPoolPreparedStatementPerConnectionSize: 20\n        filters: stat,slf4j\n        connectionProperties: druid.stat.mergeSql\\=true;druid.stat.slowSqlMillis\\=5000\n      datasource:\n          # 主库数据源\n          master:\n            driver-class-name: com.mysql.cj.jdbc.Driver\n            url: jdbc:mysql://localhost:3306/yyy-cloud?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n            username: root\n            password: lf18289339306\n          # 从库数据源\n          # slave:\n            # username: \n            # password: \n            # url: \n            # driver-class-name: \n\n# mybatis配置\n# mybatis:\n#     # 搜索指定包别名\n#     typeAliasesPackage: com.yyy.system\n#     # 配置mapper的扫描，找到所有的mapper.xml映射文件\n#     mapperLocations: classpath:mapper/**/*.xml\n\nmybatis-plus:\n  # 对应的 XML 文件位置\n  mapperLocations: classpath:mapper/**/*.xml\n  # 实体扫描，多个package用逗号或者分号分隔\n  typeAliasesPackage: com.yyy.system\n\n\n\n# swagger配置\nswagger:\n  title: 系统模块接口文档\n  license: Powered By yyy\n  licenseUrl: https://yyy.vip\n\n\n\nfileTemplate:\n  profile: fileTemplate/profile.jpg\n\n\n', 'a528ab6fcecef22ff43580c76ca1dbf5', '2020-11-20 00:00:00', '2023-06-09 11:10:41', 'nacos', '0:0:0:0:0:0:0:1', '', '', '系统模块', 'null', 'null', 'yaml', '', '');
