INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`, `encrypted_data_key`) VALUES (9, 'sentinel-yyy-gateway', 'DEFAULT_GROUP', '[\n    {\n        \"resource\": \"yyy-auth\",\n        \"count\": 500,\n        \"grade\": 1,\n        \"limitApp\": \"default\",\n        \"strategy\": 0,\n        \"controlBehavior\": 0\n    },\n\n	{\n        \"resource\": \"yyy-gen\",\n        \"count\": 200,\n        \"grade\": 1,\n        \"limitApp\": \"default\",\n        \"strategy\": 0,\n        \"controlBehavior\": 0\n    },\n	{\n        \"resource\": \"yyy-job\",\n        \"count\": 300,\n        \"grade\": 1,\n        \"limitApp\": \"default\",\n        \"strategy\": 0,\n        \"controlBehavior\": 0\n    },\n{\n        \"resource\": \"yyy-system\",\n        \"count\": 1,\n        \"grade\": 1,\n        \"limitApp\": \"default\",\n        \"strategy\": 0,\n        \"controlBehavior\": 0\n    }\n]', '73b24229e0fda2c52eae76963a3662cb', '2020-11-20 00:00:00', '2023-06-05 05:25:52', 'nacos', '0:0:0:0:0:0:0:1', '', '', '限流策略', 'null', 'null', 'json', '', '');
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`, `encrypted_data_key`) VALUES (54, 'yyy-rabbit-dev.yml', 'DEFAULT_GROUP', '# spring配置\nspring: \n    # datasource: \n    #     driver-class-name: com.mysql.cj.jdbc.Driver\n    #     url: jdbc:mysql://localhost:3306/yyy-cloud?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n    #     username: root\n    #     password: lf18289339306\n    rabbitmq:\n        host: 127.0.0.1 # 服务器 IP\n        port: 5672 # 服务器端口\n        username: guest # 用户名\n        password: guest # 密码\n        virtual-host: / # 虚拟主机地址\n        publisher-confirm-type: CORRELATED\n        publisher-returns: true\n        template:\n            mandatory: true  #定义消息路由失败时的策略。true,则调用ReturnCallback;false,则直接丢弃消息\n        listener:   \n            simple:  #容器类型.simple简单理解为一对一；direct理解为一对多个消费者\n                prefetch: 10  #消费端限流，代表多少消息未被ack时，rabbitmq不会给消费者发送新的消息\n                acknowledge-mode: MANUAL\n                retry: \n                    max-attempts: 5 \n                    enabled: true\n                    initial-interval: 5000\n                default-requeue-rejected: false\n\n\n# mybatis配置\n# mybatis:\n#     # 搜索指定包别名\n#     typeAliasesPackage: com.yyy.rabbit\n#     # 配置mapper的扫描，找到所有的mapper.xml映射文件\n#     mapperLocations: classpath:mapper/**/*.xml\n\n\n# swagger配置\nswagger:\n  title: mq模块接口文档\n  license: Powered By yyy\n  licenseUrl: https://yyy.vip\n', '9d4847a9c871d318996cd86331719dee', '2022-10-07 01:12:40', '2023-06-02 22:01:51', 'nacos', '0:0:0:0:0:0:0:1', '', '', '消息中间件', '', '', 'yaml', '', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`, `encrypted_data_key`) VALUES (89, 'sentinel-yyy-system', 'DEFAULT_GROUP', '[\n        {\n        \"resource\": \"/test/getFileTemplate\",\n        \"count\": 1,\n        \"grade\": 1,\n        \"limitApp\": \"default\",\n        \"strategy\": 0,\n        \"controlBehavior\": 0  \n}\n]', '441800afe078bf24ec8760ecd22aaf6c', '2023-06-05 04:19:06', '2023-06-05 05:06:52', 'nacos', '0:0:0:0:0:0:0:1', '', '', '', '', '', 'json', '', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`, `encrypted_data_key`) VALUES (186, 'yyy-test-dev.yml', 'DEFAULT_GROUP', '# spring配置\nspring:\n  redis:\n    host: localhost\n    port: 6379\n    database: 0\n    timeout: 10000\n    #自定义属性\n    expire: 60000\n  cache:\n    type: redis\n    #设置缓存过期时间  防止缓存雪崩：大量key同时过期\n    redis:\n      time-to-live: 3600000\n      #指定默认前缀，如果此处我们指定了前缀则使用我们指定的前缀，推荐此处不指定前缀\n      #spring.cache.redis.key-prefix=CACHE_\n      #是否开始前缀，建议开启\n      use-key-prefix: true\n      #是否缓存空值，防止缓存穿透\n      cache-null-values: true\n  datasource:\n    druid:\n      stat-view-servlet:\n        enabled: true\n        loginUsername: admin\n        loginPassword: 123456\n    dynamic:\n      druid:\n        initial-size: 5\n        min-idle: 5\n        maxActive: 20\n        maxWait: 60000\n        timeBetweenEvictionRunsMillis: 60000\n        minEvictableIdleTimeMillis: 300000\n        validationQuery: SELECT 1 FROM DUAL\n        testWhileIdle: true\n        testOnBorrow: false\n        testOnReturn: false\n        poolPreparedStatements: true\n        maxPoolPreparedStatementPerConnectionSize: 20\n        filters: stat,slf4j\n        connectionProperties: druid.stat.mergeSql\\=true;druid.stat.slowSqlMillis\\=5000\n      datasource:\n          # 主库数据源\n          master:\n          #   driver-class-name: com.mysql.cj.jdbc.Driver\n          #   url: jdbc:mysql://localhost:3306/yyy-cloud?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n          #   username: root\n          #   password: lf18289339306\n          # bank1:\n            driver-class-name: com.mysql.cj.jdbc.Driver\n            url: jdbc:mysql://localhost:3306/bank1?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n            username: root\n            password: lf18289339306\n          # 从库数据源\n          # slave:\n            # username: \n            # password: \n            # url: \n            # driver-class-name: \n\n# mybatis配置\n# mybatis:\n#     # 搜索指定包别名\n#     typeAliasesPackage: com.yyy.system\n#     # 配置mapper的扫描，找到所有的mapper.xml映射文件\n#     mapperLocations: classpath:mapper/**/*.xml\n\nmybatis-plus:\n  # 对应的 XML 文件位置\n  mapperLocations: classpath:mapper/**/*.xml\n  # 实体扫描，多个package用逗号或者分号分隔\n  typeAliasesPackage: com.yyy.test\n\n\n\n# swagger配置\nswagger:\n  title: 测试模块接口文档\n  license: Powered By yyy\n  licenseUrl: https://yyy.vip\n\n\n\nfileTemplate:\n  profile: fileTemplate/profile.jpg\n\n\n', '8fdf47084ed5ab7f6e235f064292d527', '2023-06-09 10:57:25', '2023-06-09 22:52:18', 'nacos', '0:0:0:0:0:0:0:1', '', '', '', '', '', 'yaml', '', NULL);
COMMIT;

