 '66954438b129f8091be86355e42f967a', '2023-06-02 11:48:05', '2023-06-01 22:48:05', 'nacos', '0:0:0:0:0:0:0:1', 'U', '', NULL);
INSERT INTO `his_config_info` (`id`, `nid`, `data_id`, `group_id`, `app_name`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `op_type`, `tenant_id`, `encrypted_data_key`) VALUES (6, 30, 'yyy-gen-dev.yml', 'DEFAULT_GROUP', '', '# spring配置\nspring:\n  redis:\n    host: localhost\n    port: 6379\n  # datasource:\n  #   driver-class-name: com.mysql.cj.jdbc.Driver\n  #   url: jdbc:mysql://localhost:3306/ry-cloud?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n  #   username: root\n  #   password: lf18289339306\n  datasource:\n    druid:\n      stat-view-servlet:\n        enabled: true\n        loginUsername: admin\n        loginPassword: 123456\n    dynamic:\n      druid:\n        initial-size: 5\n        min-idle: 5\n        maxActive: 20\n        maxWait: 60000\n        timeBetweenEvictionRunsMillis: 60000\n        minEvictableIdleTimeMillis: 300000\n        validationQuery: SELECT 1 FROM DUAL\n        testWhileIdle: true\n        testOnBorrow: false\n        testOnReturn: false\n        poolPreparedStatements: true\n        maxPoolPreparedStatementPerConnectionSize: 20\n        filters: stat,slf4j\n        connectionProperties: druid.stat.mergeSql\\=true;druid.stat.slowSqlMillis\\=5000\n      datasource:\n          # 主库数据源\n          master:\n            driver-class-name: com.mysql.cj.jdbc.Driver\n            url: jdbc:mysql://localhost:3306/yyy-cloud?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n            username: root\n            password: lf18289339306\n          # 从库数据源\n          # slave:\n            # username: \n            # password: \n            # url: \n            # driver-class-name: \n\n# mybatis配置\n# mybatis:\n#     # 搜索指定包别名\n#     typeAliasesPackage: com.yyy.gen.domain\n#     # 配置mapper的扫描，找到所有的mapper.xml映射文件\n#     mapperLocations: classpath:mapper/**/*.xml\nmybatis-plus:\n  # 对应的 XML 文件位置\n  mapperLocations: classpath:mapper/**/*.xml\n  # 实体扫描，多个package用逗号或者分号分隔\n  typeAliasesPackage: com.yyy.gen\n\n\n# swagger配置\nswagger:\n  title: 代码生成接口文档\n  license: Powered By ruoyi\n  licenseUrl: https://ruoyi.vip\n\n# 代码生成\ngen:\n  # 作者\n  author: ruoyi\n  # 默认生成包路径 system 需改成自己的模块名称 如 system monitor tool\n  packageName: com.yyy.system\n  # 自动去除表前缀，默认是false\n  autoRemovePre: false\n  # 表前缀（生成类名不会包含表前缀，多个用逗号分隔）\n  tablePrefix: sys_\n', '566c5efce08d9049c6832b2ae72f7a27', '2023-06-02 11:48:26', '2023-06-01 22:48:26', 'nacos', '0:0:0:0:0:0:0:1', 'U', '', NULL);
INSERT INTO `his_config_info` (`id`, `nid`, `data_id`, `group_id`, `app_name`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `op_type`, `tenant_id`, `encrypted_data_key`) VALUES (1, 31, 'application-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  autoconfigure:\n    exclude: com.alibaba.druid.spring.boot.autoconfigure.DruidDataSourceAutoConfigure\n  mvc:\n    pathmatch:\n      matching-strategy: ant_path_matcher\n\n# feign 配置\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: true\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        connectTimeout: 10000\n        readTimeout: 10000\n  compression:\n    request:\n      enabled: true\n    response:\n      enabled: true\n\n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n', 'aaa73b809cfd4d0058893aa13da57806', '2023-06-02 16:54:22', '2023-06-02 03:54:22', 'nacos', '0:0:0:0:0:0:0:1', 'U', '', NULL);
INSERT INTO `his_config_info` (`id`, `nid`, `data_id`, `group_id`, `app_name`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `op_type`, `tenant_id`, `encrypted_data_key`) VALUES (1, 32, 'application-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  autoconfigure:\n    exclude: com.alibaba.druid.spring.boot.autoconfigure.DruidDataSourceAutoConfigure\n  mvc:\n    pathmatch:\n      matching-strategy: ant_path_matcher\n\n# feign 配置\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: true\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        connectTimeout: 10000\n        readTimeout: 10000\n  compression:\n    request:\n      enabled: false\n    response:\n      enabled: false\n\n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n', '696e29d3677a10637aab03c6a007102b', '2023-06-02 16:55:12', '2023-06-02 03:55:12', 'nacos', '0:0:0:0:0:0:0:1', 'U', '', NULL);
INSERT INTO `his_config_info` (`id`, `nid`, `data_id`, `group_id`, `app_name`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `op_type`, `tenant_id`, `encrypted_data_key`) VALUES (42, 33, 'ruoyi-rabbit-dev.yml', 'DEFAULT_GROUP', '', '# spring配置\nspring: \n    # datasource: \n    #     type: com.zaxxer.hikari.HikariDataSource\n    #     driver-class-name: com.mysql.cj.jdbc.Driver\n    #     url: jdbc:mysql://localhost:3306/ry-cloud?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n    #     username: root\n    #     password: root\n    datasource: \n        driver-class-name: com.mysql.cj.jdbc.Driver\n        url: jdbc:mysql://localhost:3306/ry-cloud?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n        username: root\n        password: root\n    rabbitmq:\n        host: 127.0.0.1 # 服务器 IP\n        port: 5672 # 服务器端口\n        username: guest # 用户名\n        password: guest # 密码\n        virtual-host: / # 虚拟主机地址\n        publisher-confirm-type: CORRELATED\n        publisher-returns: true\n        template:\n            mandatory: true  #定义消息路由失败时的策略。true,则调用ReturnCallback;false,则直接丢弃消息\n        listener:   \n            simple:  #容器类型.simple简单理解为一对一；direct理解为一对多个消费者\n                prefetch: 10  #消费端限流，代表多少消息未被ack时，rabbitmq不会给消费者发送新的消息\n                acknowledge-mode: MANUAL\n                retry: \n                    max-attempts: 5 \n                    enabled: true\n                    initial-interval: 5000\n                default-requeue-rejected: false\n    mail:\n        host: smtp.qq.com #发送邮件服务器\n        username: xxx@qq.com #发送者邮箱\n        password: xxx    #发送者邮箱授权码\n        protocol: smtp #发送邮件协议\n        properties.username.smtp.auth: true #开启认证\n        properties.mail.smtp.port: 465 #设置端口465或者994\n        properties.mail.display.sendmail: xxx #可以任意\n        properties.mail.display.sendname: xxx #可以任意\n        properties.mail.smtp.starttls.enable: true\n        properties.mail.smtp.starttls.required: true\n        properties.mail.smtp.ssl.enable: true #开启SSL\n        default-encoding: utf-8\n\n# mybatis配置\nmybatis:\n    # 搜索指定包别名\n    typeAliasesPackage: com.ruoyi.rabbit\n    # 配置mapper的扫描，找到所有的mapper.xml映射文件\n    mapperLocations: classpath:mapper/**/*.xml', 'd7b2450638b977833a21ebaaffce2b22', '2023-06-02 20:27:06', '2023-06-02 07:27:06', 'nacos', '0:0:0:0:0:0:0:1', 'U', '', NULL);
