INSERT INTO `his_config_info` (`id`, `nid`, `data_id`, `group_id`, `app_name`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `op_type`, `tenant_id`, `encrypted_data_key`) VALUES (54, 44, 'yyy-rabbit-dev.yml', 'DEFAULT_GROUP', '', '# spring配置\nspring: \n    # datasource: \n    #     type: com.zaxxer.hikari.HikariDataSource\n    #     driver-class-name: com.mysql.cj.jdbc.Driver\n    #     url: jdbc:mysql://localhost:3306/ry-cloud?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n    #     username: root\n    #     password: root\n    datasource: \n        driver-class-name: com.mysql.cj.jdbc.Driver\n        url: jdbc:mysql://localhost:3306/ry-cloud?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n        username: root\n        password: root\n    rabbitmq:\n        host: 127.0.0.1 # 服务器 IP\n        port: 5672 # 服务器端口\n        username: guest # 用户名\n        password: guest # 密码\n        virtual-host: / # 虚拟主机地址\n        publisher-confirm-type: CORRELATED\n        publisher-returns: true\n        template:\n            mandatory: true  #定义消息路由失败时的策略。true,则调用ReturnCallback;false,则直接丢弃消息\n        listener:   \n            simple:  #容器类型.simple简单理解为一对一；direct理解为一对多个消费者\n                prefetch: 10  #消费端限流，代表多少消息未被ack时，rabbitmq不会给消费者发送新的消息\n                acknowledge-mode: MANUAL\n                retry: \n                    max-attempts: 5 \n                    enabled: true\n                    initial-interval: 5000\n                default-requeue-rejected: false\n    mail:\n        host: smtp.qq.com #发送邮件服务器\n        username: xxx@qq.com #发送者邮箱\n        password: xxx    #发送者邮箱授权码\n        protocol: smtp #发送邮件协议\n        properties.username.smtp.auth: true #开启认证\n        properties.mail.smtp.port: 465 #设置端口465或者994\n        properties.mail.display.sendmail: xxx #可以任意\n        properties.mail.display.sendname: xxx #可以任意\n        properties.mail.smtp.starttls.enable: true\n        properties.mail.smtp.starttls.required: true\n        properties.mail.smtp.ssl.enable: true #开启SSL\n        default-encoding: utf-8\n\n# mybatis配置\nmybatis:\n    # 搜索指定包别名\n    typeAliasesPackage: com.ruoyi.rabbit\n    # 配置mapper的扫描，找到所有的mapper.xml映射文件\n    mapperLocations: classpath:mapper/**/*.xml', 'd7b2450638b977833a21ebaaffce2b22', '2023-06-02 22:55:47', '2023-06-02 09:55:47', 'nacos', '0:0:0:0:0:0:0:1', 'U', '', NULL);
