ters:\n            - StripPrefix=1\n\n# 安全配置\nsecurity:\n  # 验证码\n  captcha:\n    enabled: false\n    type: math\n  # 防止XSS攻击\n  xss:\n    enabled: true\n    excludeUrls:\n      - /system/notice\n  # 不校验白名单\n  ignore:\n    whites:\n      - /auth/logout\n      - /auth/login\n      - /auth/register\n      - /*/v2/api-docs\n      - /csrf\n      - /auth/callback\n', '9aa83429a898b6a383415126af0c5316', '2023-06-05 15:59:31', '2023-06-05 02:59:32', 'nacos', '0:0:0:0:0:0:0:1', 'U', '', NULL);
