er-class-name: com.mysql.cj.jdbc.Driver\n          # 从库数据源\n          # slave:\n            # username: \n            # password: \n            # url: \n            # driver-class-name: \n\n# mybatis配置\n# mybatis:\n#     # 搜索指定包别名\n#     typeAliasesPackage: com.yyy.system\n#     # 配置mapper的扫描，找到所有的mapper.xml映射文件\n#     mapperLocations: classpath:mapper/**/*.xml\n\nmybatis-plus:\n  # 对应的 XML 文件位置\n  mapperLocations: classpath:mapper/**/*.xml\n  # 实体扫描，多个package用逗号或者分号分隔\n  typeAliasesPackage: com.yyy.system\n\n\n\n# swagger配置\nswagger:\n  title: 系统模块接口文档\n  license: Powered By yyy\n  licenseUrl: https://yyy.vip\n\n\n\nfileTemplate:\n  profile: fileTemplate/profile.jpg\n\n\n\n\n# tencent:\n#   SecretId: AKIDjJm3nNmwtd8NNBk2NVZbU9ZjcEdokV6R\n#   SecretKey: 92d2GJOI0ThqwwV0PhrxxqFVVTHuLYWI\n#   sms:\n#       AppKey: b766600febc4526731c7dd4deed1c0db\n#       SignName: 链橘科技\n#       SdkAppId: 1400294716\n#       TemplateID: 1579380\n\n\n# 本地文件上传    \n# file:\n#     domain: http://127.0.0.1:9300\n#     path: /Users/yyyz/Desktop/开源项目/YyyProject/uploadPath\n#     prefix: /statics\n\n\n\n# # 阿里云配置\n# aliyun:\n#   endpoint: oss-cn-hangzhou.aliyuncs.com\n#   accessKeyId: LTAI5tN7V1nzWEezuLZ17dBC\n#   accessKeySecret: jpTKv2wOZ9AMWh1aCbPI2UD9PZ1EQu\n#   bucketName: aicloud888\n#   # urlPrefix:\n', '8e13ea951454fad04906f89626754c18', '2023-06-09 22:56:30', '2023-06-09 09:56:31', 'nacos', '0:0:0:0:0:0:0:1', 'U', '', NULL);
